import React from 'react';

import SiswaItem from './SiswaItem';

function SiswaTable(props){
  let nodes = props.data.map((item, index) => {
    return(
<SiswaItem key={index}  meals={item} id = {item.id} name={item.name} type={item.type} />
    )
  })
  console.log('data item > ', nodes);

  return (
    <table className="table table-striped">
      <thead>
        <tr>
          <th>Name</th>
          <th>Type</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        {nodes}
      </tbody>
    </table>
  )
}

export default SiswaTable;
